export function delay(ms: number = 1000) {
  return new Promise((resolve) => {
    setTimeout(() => {
      resolve(true);
    }, ms);
  });
}

/**
 * \u751F\u6210\u4E00\u4E2A 1-max \u7684\u968F\u673A\u6574\u6570
 * @param max
 */
